import { useState } from "react";

export const QuickCart = ({ onClick }) => {
  const [open, setOpen] = useState(false);
  return open ? (
    <h1>OK</h1>
  ) : (
    <a
      onClick={() => {
        setOpen(true);
        onClick();
      }}
    >
      Mua nhanh
    </a>
  );
};
